INSERT INTO `objets` VALUES (6,'Bataille de Lépante','La plus grande bataille navale de l\'époque moderne, elle oppose la flotte ottomane aux flottes chrétiennes de Venise et de l\'Espagne pour défendre la colonie vénitienne de Chypre.','7 octobre 1571','Thomas'),(7,'L\'attentat de Sarajevo','A Sarajevo, le prince héritier François-Ferdinand d\'Autriche et sa femme sont assassinés par le serbe Gavrilo Princip. Cet attentat est à l\'origine de la déclaration de guerre autrichienne à la Serbie et de la Première Guerre mondiale.','28 juin 1914','Thomas'),(8,'La Chute de Constantinople','Après presque 2 mois de siège, la capitale de l\'Empire romain d\'Orient (aussi appelé Empire Byzantin) est prise par l\'armée ottomane du sultan Mehmet II. Le dernier empereur romain Constantin XI meurt dans la défense de la ville','29 Mai 1453','Thomas'),(9,'Le couronnement impérial de Charlemagne','Le jour de Noël de l\'an 800, Charlemagne est sacré Empereur d\'Occident par le Pape Léon III. Après ses vastes conquêtes, ce sacre fait de Charlemagne l\'héritier des Empereurs romains d\'Occident.','25 décembre 800','Thomas'),(10,'Traité de Schönbrunn','Ce traité de paix met fin à la Cinquième Coalition anti-française. Par sa victoire, Napoléon force l\'Autriche à céder de vastes territoires à la France et à la Pologne, et à reconnaître l\'influence française sur le trône d\'Espagne.','14 octobre 1809','Thomas'),(11,'Le passage des Alpes par Hannibal','En guerre contre Rome, l\'armée carthaginoise d\'Hannibal Barca traverse les Alpes pour pénétrer en Italie. Hannibal réussit à passer le  col du Saint-Bernard avec ses fantassins et ses éléphants de guerre, qui infligeront de sévères défaites aux romains.','Automne -218','Thomas'),(12,'Le Printemps des peuples','En 1848, des révolutions éclatent dans toute l\'Europe, suivant l\'exemple de la Révolution française. En Pologne, en Italie, en Hongrie, en Roumanie, en Bohême, en Allemagne et dans les Balkans, les peuples se soulèvent contre les monarchies absolues.','1848','Thomas'),(13,'Accords de Munich','Les représentants de la France, du Royaume-Uni et de l\'Italie se réunissent à Munich pour négocier avec Hitler du sort des allemands de Tchécoslovaquie. La Tchécoslovaquie y est abandonnée par les occidentaux pour éviter la guerre.','30 septembre 1938','Thomas'),(14,'Chute du Mur de Berlin','Après plus de 40 ans de séparation entre l\'Allemagne de l\'Est et l\'Allemagne de l\'Ouest, les allemands traversent librement pour la première fois de Mur, symbole de la guerre froide, dans le contexte de la dislocation du Bloc de l\'Est.','9 novembre 1989','Thomas'),(15,'Découverte de l\'Amérique par Christophe Colomb','Soutenu par la reine Isabelle de Castille, l\'explorateur génois Christophe Colomb traverse l\'Atlantique et découvre l\'île de Guanahani, aux Caraïbes.','11 octobre 1492','Thomas'),(16,'Baptême de Clovis','Le jour de Noël 496, le roi des Francs Clovis Ier se convertit à la foi catholique en présence de l\'évêque Rémi de Reims. Cet évènement est souvent considéré comme l\'un des points de départ de l\'Histoire de France.','25 décembre 496','Thomas'),(17,'Débarquement en Normandie','Pour soutenir l\'avancée soviétique à l\'est, les armées alliées débarquent le 6 juin sur 5 plages normandes. Plus de 150 000 soldats d\'une dizaine de nationalités différentes se lancent alors dans la reconquête de la France et de l\'Europe de l\'Ouest.','6 juin 1944','Thomas'),(18,'La Traversée du Rubicon','César passe avec son armée le fleuve du Rubicon, frontière symbolique de Rome, en prononçant les mots \"Alea jacta est\", \"Les dés sont jetés\". Il déclare par conséquent la guerre civile au Sénat et à Pompée le Grand.','10 janvier -49','Thomas'),(19,'Déposition de Romulus Augustule','Le dernier empereur romain d\'Occident, Romulus Augustule âgé de seulement 15 ans, est déposé par  Odoacre, un soldat romain d\'origine barbare, qui se déclare \"Patrice d\'Italie\". Cet évènement marque le passage de l\'Antiquité au Moyen-Âge.','4 septembre 476','Thomas'),(20,'Appel de Clermont','Le pape Urbain II appelle les catholiques à s\'en aller mettre un terme aux massacres de chrétiens d\'Orient et aux profanations menées par les turcs Seldjoukides, pour sécuriser les pèlerinages vers Jérusalem. C\'est le début de la Première Croisade.','27 novembre 1095','Thomas'),(21,'Rétrocession de Macao','Le Portugal est forcé de rétrocéder à la Chine sa dernière colonie: Macao. 2 ans après la rétrocession de Hong Kong par les anglais, cet évènement marque la fin du colonialisme européen sur le continent asiatique.','20 décembre 1999','Thomas'),(22,'Paix de Westphalie','Ces traités de paix mettent fin à la Guerre de Trente Ans, entre les Catholiques et les Protestants de l\'Empire et la quasi-totalité des grandes puissances européennes.\r\nC\'est la fin des Guerres de Religion.','24 octobre 1648','Thomas'),(23,'Le premier Homme dans l\'Espace','Le soviétique Youri Gagarine embarque dans la mission Vostok 1. Au sein du vaisseau Vostok 3KA, il reste plus d\'une heure et demi dans l\'espace avant de réatterrir à Saratov. ','12 avril 1961','Thomas'),(24,'Traité de St-Clair-sur-Epte','Le chef viking Rollon se voit attribuer la région de Rouen (actuelle Seine-Maritime) en l\'échange de la protection de Paris des attaques viking remontant la Seine.\r\nC\'est l\'acte fondateur du Duché de Normandie.','Automne 911','Thomas'),(42,'Lorem ipsum','Lorem ipsummm\r\n','Lorem ipsum','bart'),(43,'Lorem ipsum','...','Lorem','bart');
